// DeleteUniqueIndexCache 删除索引存在的缓存
func (a *AiChatConversationRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.AiChatConversation) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, a.cache.Key(CacheAiChatConversationByConditionPrefix))
	keys = append(keys, a.cache.Key(CacheAiChatConversationUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[a.cache.Key(CacheAiChatConversationByIDPrefix, item.ID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatConversationUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatConversationByAdminIDPrefix, item.AdminID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatConversationUnscopedByAdminIDPrefix, item.AdminID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatConversationByTenantIDPrefix, item.TenantID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatConversationUnscopedByTenantIDPrefix, item.TenantID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := a.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
